  \"narrative-report-crescent-lake-refuge-september-october-november-december-1942\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1942. The report begins by summarizing the weather conditions, water
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  raptors, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and wildfires. Resource management is
  outlined; topics include grazing and haying. The public relations section of the
  report describes Refuge visitors. N-R forms and photographs are attached.\",\n\t\"license_title\":
